import React from "react";
import { Sidenav, Panel } from "rsuite";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">Covid</header>
      <Sidenav>
        <Sidenav.Header>Hello</Sidenav.Header>
        <Sidenav.Body>1st</Sidenav.Body>
        <Sidenav.Body>2nd</Sidenav.Body>
      </Sidenav>
    </div>
  );
}

export default App;
